import React from 'react';
import ImageToggleOnScroll from '../src/ImageToggleOnScroll';

const ImageChangeOnScroll = () => {
	return (
		<div>
			{[187, 823, 1124, 2920, 6548, 8590].map(speaker => (
				<ImageToggleOnScroll
					primaryImage={`/static/speakers/bw/Speaker-${speaker}.jpg`}
					secondaryImage={`/static/speakers/Speaker-${speaker}.jpg`}
					alt=''
				/>
			))}
		</div>
	);
};

export default ImageChangeOnScroll;
